INSERT INTO `courses` VALUES ('CS 109','MICROS Tour','Meeting with Compro students at MICROS company','Meeting with Compro students at MICROS company'),('CS 110','ICC Tour','Meeting with Compro students at ICC, Ohio','Meeting with Compro students at ICC, Ohio'),('CS000','JSearch','Full-time Job Search','Job Search (Sept 04 students only)'),('CS108','Des Moines Trip','Meeting with Compro Students by Dr. Gregory and Elaine Guthrie','Meeting with Compro Students by Dr. Gregory and Elaine Guthrie'),('CS208','Seattle Trip','Meeting with Compro Students by Dr. Gregory and Elaine Guthrie','Meeting with Compro Students by Dr. Gregory and Elaine Guthrie'),('CS220','Data Structures','NULL','Data Structures'),('CS390','FPP','Fundamentals of OO Programming','Fundamental Programming Practices'),('CS401','MPP','Modern Programming Practices','Modern Programming Practices'),('CS422','DBMS','Database systems organize and retrieve information, allowing the user to access the desired information easily and efficiently. Topics include: relational data model; SQL; ER modeling; relational algebra; data normalization; transactions; objects in the database; data security and integrity; data warehousing, OLAP, and data mining; distributed databases; and study of a specific commercial database system. (4 units) Prerequisite: CS 401 or consent of the department faculty.','Database Management Systems'),('CS423','System Analysis & Design','The systems approach is an organized way of dealing with a problem. The software systems development life cycle (SDLC) has three major phases. It begins with preliminary and feasibility studies to make the decision to develop a system to solve a particular problem in a cost-effective and timely way. This is followed by a detailed system study, in which every aspect of the current system is analyzed and a new system is designed to meet the needs of the organization. Finally, the system design is brought to life through software engineering techniques including coding, testing, implementation and maintenance of the system. This course focuses on the middle phase. A system is studied in detail to gather requirements and its process elements analyzed for suitability and relevance to meet the needs of the system’s users. This is followed by an iterative and creative design process, using tools such as flowcharts, data flow diagrams (DFD), data dictionary, decision tables and decision trees, to provide an effective and detailed design of the system.','System Analysis and Design'),('CS424','FOOP','This course presents the key principles of object-oriented programming. Students will learn how to write reusable and better maintainable software, and they integrate this knowledge with laboratory assignments and projects. Topics include: Fundamental principles and models of object-oriented programming, UML class diagrams, and design principles that promote reusability and maintainability of software. (2 units)','Fundamentals of Object- Oriented Programming'),('CS425','SWE','The Software Engineering course introduces the student to best practices in software development through a software development methodology. Students have already had some experience in previous courses with the Object Oriented paradigm and have used some of the basic UML diagrams for purposes of modeling relationships between software objects. In Software Engineering, the student will develop skills in putting these tools together to produce robust, easily maintainable software. A software development methodology describes when and how OO concepts and UML diagrams should be used to accomplish the aim of building quality software. The course centers around a small project in which the principles discussed in the lecture format can be illustrated and applied. By the end of the course, the student will have a running application, built in accord with the high standards of the RUP (Rational Unified Process) development methodology.','Software Engineering'),('CS428','Software Development with Fundamental Design Patterns','This course is an introduction to 23 GoF (Gang of Four) design patterns. Design Patterns are proven solutions to recurring problems in object-oriented software design/development. Our course will cover the rationale and benefits of using them in real projects, with an emphasis on both the intellectual understanding and the ability to discover, apply, and implement them correctly (in Java) in any software project.','Software Development with Fundamental Design Patterns'),('CS435','Algo','This course presents methods for analyzing the efficiency of algorithms (including worst-case and average-case analysis) and introduces a variety of known, highly efficient algorithms. Analysis, design, and implementation of algorithms are given equal emphasis. Topics include searching and sorting, efficiency of operations on data structures (including lists, hashtables, balanced binary search trees, priority queues), graph algorithms, combinatorial algorithms, recurrence relations, NP-complete problems, and special topics as time allows.(4 units) Prerequisites: CS 401 and MATH 272, or consent of the department faculty.','Algorithms'),('CS436','Robotics','NULL','Robotics'),('CS440','Cmpl','Students learn the successive stages and detailed mechanics by which high-level programming languages are translated into machine language by a compiler. Topics include language and grammar specification, compiler structure, compiler generation tools, lexical analysis, parsing, syntax analysis, semantic analysis, intermediate language, code generation and optimization, storage management and linkages, user interface, and a large programming project implementing part of a compiler. (4 units) ','Compilers'),('CS450','NET','Computers are connected with high-speed communication lines in local area or wide area networks, for the purpose of sharing databases and distributing workloads to increase efficiency and improve service. Topics include sampling and information theory, error detecting and correction codes, network architecture, communication protocols and models, protocol analysis, hardware components, logical and physical topology, message routing and switching, flow control, local area networks, and data security. (4 credits) Prerequisite: CS 401 or consent of the department faculty.','Networks'),('CS455','DC2','This course will cover the most current emerging methods, principles, and practices in','Software Technologies'),('CS456','Software Testing','The process of analyzing a software item to detect the differences between existing and required conditions (that is bugs) and to evaluate the features of the software items. [IEEE Standard 610.12-1990]','Software Testing'),('CS465','OS','An operating system controls the central resources of the computer system and allocates them to individual users. Course topics include sequential and concurrent processes, mutual exclusion, resource sharing, process cooperation, deadlock, resource allocation, processor scheduling, memory management, segmentation and paging algorithms, timesharing systems, scheduling algorithms, and resource protection. (4 units) ','Operating Systems'),('CS466','CompSec','Knowledge of computer security is essential when writing software that will be used over a network.  The overall theme of the course is the study of the main principles in the design of secure systems.  Topics include access control mechanisms, cryptography, authentication, representing identity, malicious logic, auditing, intrusion detection, network security, system security, and user security.  The course features weekly labs in security theory which are applied to existing systems, such as .NET, Java, Windows XP, and Unix.  The course also relates the principles and concepts of computer security to the Science and Technology of Consciousness and Maharishi Vedic Science. ','Introduction to Computer Security'),('CS470','KBS (AI)','The field of artificial intelligence attempts to create computer programs that reflect the values of human intelligence. Course topics include state-space representations, tree and graph searches, predicate calculus and deduction, heuristics, learning and problem solving, natural language processing, expert systems, and programming languages for artificial intelligence. (4 units) ','Knowledge-Based Systems (AI)'),('CS471','Parallel Programming','The standard processor for all new computers is now a multi-core processor. Each','Parallel Programming'),('CS472','Web Prog','This course provides a systematic introduction to programming interactive and dynamic web applications.  The course is intended for individuals with little or no prior web application programming experience.  This offering will use PHP for server side processing.  PHP is a widely used web application server side scripting language.  It has been used for some very large systems (e.g., Facebook), but generally is used for smaller applications.  The course will introduce HTML and CSS as they are currently used, and also covers Javascript, Ajax, jQuery, and web security.   ','Web Programming'),('CS473','MDP','Smart phones (including tablets) were predicted to out-ship the combined global market of laptop, desktop, and notebook computers in 2012. They did so in the last quarter of 2010, two years earlier than predicted! This course will prepare the students to program for a mobile device. The course will be project based, converting a 4500 line HTML5/Javascript/CSS3 app to a native Android app written in Java. Each student will be assigned a Samsung 7 tablet to use during the course. The first quarter of the course will familiarize the students with the Javascript app and examine the best practices that were employed in writing it. The next half of the course will convert most of the Javascript app to Java. The remaining 1/4 of the course will explore aspects of native Android programming such as the use of the camera and the accelerometer that were not used by the Javascript app. Prerequisite: CS472 or consent of the department faculty.','Mobile Device Programming'),('CS475','Computer Graphics','The objective of Computer Graphics is to introduce the students to the basic concepts and challenges found in the areas of 2D and 3D Computer Graphics. Theory concepts will be covered in the first part of each lesson. Then, the concepts will be demonstrated using a programming API (Java2D, Java3D or OpenGL). This is a course on how to program Computer Graphics. It is NOT a course on how to use software to edit images, such as Photoshop or GIMP.','Computer Graphics'),('CS476','Image Processing','Selected topics in Image Processing','Selected topics in Image Processing'),('CS487','DComp&XML','This course will investigate the uses of XML in distributed computation. First an understanding of the W3C specifications for XML, XML Schema, XPath, XML namespaces, XSLT and XQuery will be acquired. Then three important applications of XML in distributed computing will be investigated: syndication, web services and Ajax. Finally, advanced issues such as encrypted XML and binary XML will be considered. There will be daily labs using .NET 2.0','Distributed Computing and XML'),('CS488','Big Data Analytics ','Big Data is the new natural resource: data is doubling every 12-18 months. This new Big Data Analytics course covers the fundamental concepts and tools for mining large diverse data sets to generate new insights. You will master the use of R language to create Wordcloud, Pagerank, Data Visualization, Decision Trees, Regression, Clustering, Neural Networks, and more. You will work with some large multi-million record datasets, and also mine Twitter feeds. You will learn Hadoop/MapReduce and Streaming Data concepts, and will explore other Apache Big Data Projects such as Spark, Flink, Kafka, Storm, Samza, NoSQL through individual research papers. You will work in groups on open projects from Kaggle.com to compete for prize money by solving best-of-breed data-analytic challenges.  You will also learn to use industry-leading IBM SPSS Modeler, and open-source data mining platforms.  The #1 bestseller textbook used in this course is written by the instructor himself. The course will also use a wide range of video training materials from MIT, Coursera, Google, and elsewhere. ','Big Data Analytics'),('CS490','Seminar','Computer Science Seminar','Seminar'),('CS490-01','Rules Engines','In this seminar, we will examine current industry trends in managing business rules. We will discuss pros and cons of externalizing rules and the emerging industry standards for implementation of a rules engine. The course will provide hands-on experience with a medium-scale rules engine.','Building Rules Engines For Business Applications'),('CS490-02','Dynamic Software Architecture','Software architecture is the discipline a software engineer needs to learn in order to become a software architect looking at the holistic value of software engineering and computer science, balancing conflicting constraints of the reality of projects and client needs with the background of computer science and software engineering disciplines. An architect is responsible for bridging the gap between business and IT (informationtechnology) and is a catalyst for innovation, creativity grounded in solid decisions, best-practices and patterns that describe how to suit the way you design and build software to the problems at hand. ','Dynamic Software Architecture'),('CS490-03','.NET and XML','The purpose of the course is to examine how XML is used is distributed ','.NET and XML'),('CS490-04','EJD','The current J2EE standard offers different technologies, which are well known for their complexity. As a result of this complexity, new frameworks have been created to make enterprise Java development much simpler. In this seminar we will look at the most popular current frameworks.','Enterprise Java (JSF, Spring and Hibernate)'),('CS490-05','.NET','Principles of Computer Science  used to structure the .NET 2.0 Framework','Principles of Computer Science in .NET'),('CS490-06','APP','NULL','Advanced Programming Practices (in Java)'),('CS490-08','SWE & DComp','This seminar will apply software engineering process methodology to distributed computing technologies.  The seminar will feature a project in which we will transform the java application developed as the project in the software engineering course (CS425) into a web application using distributed computing techniques that were covered in the distributed computing course (CS545).  In addition to transforming the desktop application into a distributed web application using J2EE technologies, the seminar will apply the Rational Unified Software Development process methodology to the development steps for developing a distributed web application.','Software Engineering and Distributed  Computing'),('CS490-11','MPL','Modern Programming Languages','Modern Programming Languages'),('CS490-12','Concurrent Programming','Concurrent Programming in Java','Concurrent Programming in Java'),('CS490-13','Image Processing','Selected topics in Image Processing','Selected topics in Image Processing'),('CS490-14','Graph Algo.','This is a second course in Algorithms, emphasizing techniques for working with directed graphs. The course has a general goal of improving the student\'s skills in algorithm design, complexity analysis, and algorithm implementation. The student will develop new ways of thinking about algorithms and the ability to convert new problems to known forms; to formulate new algorithms; describe algorithms in pseudocode; determine the most efficient algorithm to solve a problem from among several competing options. ','Graph Algorithms'),('CS490-15','SW Testing','The objective of the course is to give software engineering students theoretical and practical exposure to software testing, enhance their professional skill-set and expand their employment opportunities and career choices.','Software Testing Primer for Software Engineering'),('CS490-16','UML-BA','UML Business Analysis (UML BA) is the discipline that bridges the gap between Business Experts (Sponsors or Stakeholders) and IT Experts. It brings business knowledge, policies and rules to the supporting Information System.','UML Business Analysis'),('CS490-17','Data','Data: Representation & Manipulation','Data: Representation & Manipulation'),('CS490-18','Combination Seminar','Combination Seminar','Combination Seminar'),('CS490-19','Robot - Human Interface','NULL','Robot - Human Interface'),('CS490-20','Software Modeling','NULL','Software Modeling'),('CS490-21','Business Rules','NULL','Business Rules'),('CS490-22','JPA','Using Java technologies Persistence is possible with JPA, the JPA specifications were introduced by Sun with EJB 3.0. Using an underlying Persistence Framework Hibernate we will be discovering how to easily and simply persist and work with a database as a simple object, while still being able to apply all the object-oriented techniques we know.','Persistence using JPA & Hibernate'),('CS490-23','EJB 3.0','Enterprise JavaBeans is the core component technology of the Java Enterprise Edition platform. It is an enterprise infrastructure designed to provide developers with the automatic management of many of the services essential to enterprise applications. This seminar will focus on the various features and components of the Enterprise JavaBean 3.0 framework and its use in enterprise application development. Required book: Enterprise JavaBeans 3.0, Bill Burke & Richard Monson-Haefel, 5th Edition, O\'Reilly 2006','Enterprise Application Development with Enterprise JavaBeans 3.0'),('CS490-24','Scripting','One of the most important current trends in computing is the development and growth of dynamic scripting languages, which supplement the larger system development languages like Java and C#. These dynamic languages provide a simpler and yet also more integrating approach to programming which makes them ideal for smaller projects, system administration and scripting, and prototyping.','Scripting Languages and Dynamic Web frameworks'),('CS490-25','FSM','A finite state machine (FSM) or finite state automaton (plural: automata) or simply a state machine is a model of behavior composed of a finite number of states, transitions between those states, and actions.','Software Modeling with Finite State Machines'),('CS490-26','Persistence using nHibernate & Microsoft Linq','Using Microsoft technologies Persistence is possible by either using an open source solution very much similar to the well known Hibernate solution, this is known as nHibernate, another approach is to use Microsoft Entity Manager Framework and the new Linq technology introduced with C# 3.0, we will try to see how to persist under the .net framework. Using nHibernate or Linq make it simple and very efficient to work with databases. While Linq may also be used to query any data stream we will only be focusing on databases during our short visit to Linq.','Persistence using nHibernate & Microsoft Linq'),('CS490-27','DARCH','This seminar will investigate various patterns used in the development of complex enterprise application architectures, including layering, organizing domain logic, object-relational mapping, concurrency, session state and distribution strategies.','Patterns of Enterprise Application Architecture'),('CS490-28','EDM','In this course we will investigate various analysis patterns, business patterns, archetypes and archetype patterns and learn how they can be used to effectively and accurately model a specific business domain in order to implement an enterprise application to support the organization’s business operations. Many of these aspects can be equally applied to technical domains. We will discuss how the domain model forms the basis for all aspects of the enterprise application development providing a strong foundation for organizing domain logic (business logic), designing a database schema and developing user interface screens. We will also see how the Enterprise Application Domain Model acts as the communication centerpiece bridging the age old language chasm between business and technical departments as well as supporting the communication and development efforts within the development team. Enterprise Application Domain Modeling is an essential skill for any modern enterprise developer, architect and analyst alike.','Pattern-Oriented Enterprise Domain Modelling'),('CS490-29','JPA','Hibernate is an object-relational mapping (ORM) library for the Java language, providing a framework for mapping an object-oriented domain model to a traditional relational database. Hibernate solves object-relational paradigm mismatch problems by replacing direct persistence-related database accesses with high-level object handling functions. Hibernate\'s most primary feature is mapping from Java classes to database tables (and from Java data types to SQL data types). Hibernate also provides data query and retrieval facilities. Hibernate generates the SQL calls and relieves the developer from manual result set handling and object conversion, keeping the application portable to all supported SQL databases, with database portability delivered at very little performance overhead. The Java Persistence API, sometimes referred to as JPA, provides a POJO persistence model for object-relational mapping. The Java Persistence API was developed by the EJB 3.0 software expert group as part of JSR 220, but its use is not limited to EJB software components. It can also be used directly by web applications and application clients, and even outside the Java EE platform, for example, in Java SE applications.','Hibernate & JPA'),('CS490-30','Software Testing','In this seminar students will learn the art and science of software testing. The seminar will focus on:','The process of analyzing a software item to detect the differences between existing and required conditions (that is bugs) and to evaluate the features of the software items. [IEEE Standard 610.12-1990]'),('CS490-31','Mobile Dev','There has been an dramatic increase in the number of mobile devices, e.g., smart phones, that are capable of running sophisticated programs. Companies are becoming interested in designing applications that are meant to run on a mobile device.  In this course, we investigate what mobile app development has in common with desktop applications and how it differs. In the labs we will develop a simple Android app. If you have an idea for an mobile app you will be able to start development on it instead of doing the assigned lab.','Introduction to Mobile Device Programming'),('CS490-32','Project Management','General Course Goals: ','Project Management Seminar'),('CS490-33','Software Design','This seminar will focus on the design, architecture and modelling software systems. It covers the core design principles and explores their relationship with the various design methodologies that have been proposed over the years. Some of the most common design approaches and patterns that are being used in the industry will be discussed. It will also deal with software architecture and its influence on important software qualities. Finally, the seminar will highlight the mathematical documentation and modelling aspects of software systems.','Software Design Seminar'),('CS490-34','JEE',NULL,'Java Enterprise Edition'),('CS490-35','Principles of Enterprise Application Development','Principles of Enterprise Application Development (using Spring and Hibernate)','Principles of Enterprise Application Development'),('CS490-36','Spring/Hibernate (Seminar-2 Units)','This seminar focuses on teaching the core principles of the Spring and Hibernate Frameworks. We will examine the different architectural layers that are frequently used when creating an enterprise application with Spring and Hibernate and at the different technologies associated with these layers. We start with Object Relational Mapping (ORM) with Hibernate, then move on to Dependency Injection (DI) and Aspect Oriented Programming (AOP) with Spring. We will finish things up with a discussion on application integration with web service, java messaging service (JMS), remote method invocation (RMI), and if time allows Spring MVC. This seminar will have a $25 materials fee (or $20 if you provide your own binder). and will not be open to students who have taken CS544 Enterprise Architecture with Michael Zijlstra.','Spring/Hibernate (Seminar-2 Units)'),('CS490-37','Business Intelligence and Data Mining',NULL,'Business Intelligence and Data Mining'),('CS490-39','Cloud computing','Cloud computing is a fundamental change from how computers and software have worked in the past.  Instead of buying computers and running software on it, the infrastructure is put together using building blocks purchased from service providers. Primary focus is on developing applications. Topics in this course include fundamentals of cloud computing, Google App Engine and Google Web Toolkit. Knowledge of Java is essential and experience in JSP is very helpful.','Cloud computing'),('CS490-40','Persistence and Web Frameworks','During this seminar we will cover Persistence using ORM (Object Relational Mapping) using JPA.','Persistence and Web Frameworks'),('CS490-41','High Performance Distributed Computing','C and C++ are among the most popular programming languages in use today for commercial software development, especially for compute intensive applications where good performance is required, such as financial modeling, weather prediction, image processing, signal processing, and airplane design. To improve program performance beyond that achievable by a single computer, a group (or “cluster”) of computers can be connected with a network and programmed to work together on a single computing application task. This course will present practical programming techniques for such high performance distributed applications using C/C++ and the popular Message-Passing Interface (MPI) standard library. ','High Performance Distributed Computing using C++'),('CS490-42','Object-Oriented Analysis of Design Strategies','NULL','Object-Oriented Analysis of Design Strategies'),('CS490-43','Thread Programming in Java','Concurrency has long been important to the efficient utilization of hardware and system software.  With new technologies such as Dual and Quad Core processors as well as the need for network and distributed systems, concurrent programming is now becoming more important in modern software applications.','Thread Programming in Java'),('CS490-44','Robotics','NULL','Robotics'),('CS490-45','Programming Languages','NULL','Programming Languages'),('CS490-46','Information Security','Information security threats such as viruses and clever hackers are increasing at an alarming rate every day.  Securing information and information systems demands a proactive approach and a clear understanding of vulnerabilities and associated protective measures. Such measures cannot stop all network intrusions or system attacks but it can empower network engineers and software developers to eliminate general problems, greatly reduce potential damages and quickly detect breeches. This course focuses on the fundamental principles of information security, cryptography algorithms, access control mechanisms, software security, network security, physical security and security assessment and risk management.','Information Security'),('CS490-47','Professional C++','Professional C++ 11','Professional C++ 11'),('CS490-48','Data Management System','This course covers the concepts and methods associated with the definition, structure, creation, and utilization of databases for computer-based information systems. Students will undertake a class project that will require creating the logical design of business database application and implementing it using a current database development platform .','Data Management System'),('CS490-49','Data Mining','Data mining centers on finding novel, interesting, and potentially useful patterns in data. It aims at transforming a large amount of data into a well of knowledge. Data mining has become a very important field in industry as well as academia. The course covers most of the important data mining techniques and provides background knowledge on how to conduct a data mining project. Students will be required to carry out their individual research and apply every of the data mining topic they studied over real world dataset starting from Pre-processing, Defining the analysis model, Visualization and Result comparison in form of application. More','Data Mining'),('CS490-50','Database System Project ','The purpose of this course is to allow students to review, integrate, and utilize the knowledge gained in their other courses at MUM, as a final preparation for beginning job search. Students will work in small teams to implement a telephone company Rates Management and Billing System. A complete set of specifications and sample data will be provided by the instructor. To keep the project simple, only country to country international calls will be considered. The database will include international calling rates, customer information, and telephone call detail files. The system will generate rate sheets, monthly customer bills, and call traffic summaries. ','Database System Project '),('CS490-51','Developing Web Applications with the WordPress Software Foundation','WordPress can be used to refer to either a blogging platform (wordpress.com), or a CMS/technology as a web development tool (wordpress.org). According to Wikipedia, over 20% of the top 10 million websites worldwide are based on WordPress. Notable users include NYtimes, CNN, Forbes, Reuters, etc. This seminar is about the latter and offered to both plugin (back-end) and theme (front-end) developers or anyone else who is interested to learn it. During the seminar, we will be talking about how the WordPress Software Foundation works (or how the WordPress engine works), its main APIs, how to develop WordPress plugins and themes, etc. We will also set up a local WordPress development environment with WAMP, learn how to use its admin dashboard, how to install themes and plugins and then develop a reservation system for a hotel. The seminar differs from most other similarly-titled training courses in that it focuses on how the WordPress core works followed by practical sessions on how to extend the core by using WordPress key APIs. Students taking the seminar should understand or have work experience with web development technologies such as php (or perl/python/Java/C#, etc), html, css and jQuery.','Developing Web Applications with the WordPress Software Foundation'),('CS490-52','Advanced Programming Languages: Functional Programming','The newest additions and directions for OO programming in Java-8 (lambdas, streams), F#, C# (LINLQ), Scala – all are coming from the area of Functional Programming. Programming languages co-evolve, that is they evolve as a group, all reflecting the current thinking and knowledge level of the programming community, and the discipline of Computer Science. The main current programming languages (Java, C#, C++) all include significant language improvements in the next (and recent) releases, and one of the most significant trends in this area is the inclusion of functional programming concepts and support. This functional trend is based on many aspects, including simplicity, power, and clarity of the programs, reduced errors, and more adaptable to parallelism.Each language presents a new approach to thinking and problem solving. Even if it does not become your main development tool, you will benefit from the new ideas and experience of a new view and approach to programs and problem solving.','Seminar in Advanced Programming Languages: Functional Programming'),('CS490-53','Advanced Java Programming','This seminar is an introduction to the new CS concepts that have been incorporated into the Java SE 8 language. The central topic is lambda expressions, which are an implementation within Java of especially useful aspects of the functional programming paradigm. The many applications that will be discussed will include introductions to JavaFX (Java s new windowing toolkit that replaces Swing) and the stream API (which provides support for declarative programming over Java collections and for parallelizing operations on them). These new features represent revolutionary changes in the design and coding of Java programs.','Advanced Java Programming'),('CS490-54','Advanced Web Programming','This seminar will explore new features for web app programming introduced in HTML5.  It will also provide extensive exercise of advanced features of JavaScript commonly used in modern web applications.  HTML has primarily been viewed as a markup language for documents.  HTML5 is the first version to embrace the web as a platform for web application development.  HTML5 defines new HTML elements for rich Internet apps as well as a variety of JavaScript APIs for browsers to implement natively.   This seminar will be a lab intensive course that will develop a set of applications using the new HTML5 standards, including rich and highly responsive client-side form functionality, drag/drop interactions, rich-text editing, local file management, geolocation, a chat application utilizing server-sent events and WebSockets, client storage and offline execution.Must have taken CS472 Web Application Programming or passed the written waiver exam for CS472.  The course assumes an understanding of JavaScript programming including closures, callbacks, namespaces, scope, Ajax, JSON, and jQuery','Advanced Web Programming'),('CS490-55','JQuery Seminar','NULL','JQuery Seminar'),('CS490-56','Advanced Mobile Programming','NULL','Advanced Mobile Programming'),('CS490-57','Seminar on Single Page Web Applications','-','Seminar on Single Page Web Applications'),('CS502','SA','Seminar: Please see the email sent to you about block10-CD for a description','Software Architecture'),('CS505','APL','This course considers advanced topics in programming language design as a basis for understanding the principles of all programming languages, with emphasis on formal methods and abstraction mechanisms. Topics include methods of data and control abstraction, alternate programming paradigms, formal specification of syntax and semantics, advanced control structures, and study of specific languages. (4 units)','Advanced Programming Languages'),('CS522','Big Data',NULL,'Big Data'),('CS525','ASD','This course considers the current methods and practices for good design of software systems. Topics include: software design patterns, frameworks, architectures, and designing systems to apply these multi-level abstractions. (2–4 units) Prerequisite: CS 425 ','Advanced Software Development'),('CS544','EA','NULL','Enterprise Architecture'),('CS545','WAA','Prerequisite course:  CS472 Web Application Programming is a prerequisite for this course.  Students must have completed that course with a grade of B or better to enroll in this course.  Completion of CS544 Enterprise Architecture with B or better is also sufficient.  All other students must obtain permission from the instructor.  Students with similar coursework from other schools or relevant work experience will also qualify, but must email the instructor with a description of the relevant work.    WAA course introduces students to fundamental principles of Web Application and particularly development of web applications.  The course focuses on server side processing and programming to support distributed interactions in an Internet or Intranet architecture.  This includes focus on processes, protocols, programming patterns and architectures that underlie the request/reply computing paradigm that has developed for the web application paradigm.  The course content emphasizes server to browser applications and technologies, but also introduces web service applications.  Both of these paradigms use the HTTP protocol as their basic communication mechanism.  This course does not cover backend enterprise computing issues such as persistence, transaction processing, security, etc., which are covered in the Distributed Architecture course (CS547).','Web Application Architecture'),('CS547','DARCH','Seminar: Please see the email sent to you about block10-CD for a description','Distributed Computing Architecture'),('CS572','MWA',' ','Modern Web Applications'),('CS582','Machine Learning','Machine Learning, the field of study that gives computers the ability to learn  from data, is at the heart of almost every scientific discipline, and the study of generalization (that is, prediction) from data is the central topic of machine learning.  This course gives a graduate-level introduction to machine learning  and in-depth coverage of new and advanced methods in machine learning, as well as their underlying theory. It emphasizes approaches with practical relevance and discusses a number of recent applications of machine learning, such as Data Mining (in Big Data / Data Science, Data Analytics), Natural Language Processing, Computer Vision, Robotics, Bioinformatics and Text and Web data processing.  Machine Learning is used in various industries including Financial Services, Oil & Gas, Health Care, Marketing & Advertising, Government, Internet and Internet of Things.','Machine Learning'),('Entry','Compro Entry','Not a real class, just the Compro Entry Group','Compro Entry Group'),('FOR101','Forest','This course explores the extraordinary story of how the world reawakened to the knowledge of enlightenment. About fifty years ago Maharishi responded to the need of the time for higher consciousness and set out from India to bring the experience of transcending to the West. This experience ignited a global awakening, transforming consciousness and the quality of life for millions of people. Through guest speakers who worked personally with Maharishi, heartwarming videotapes, and interviews, students will get a picture of this transformative time in human history. Students will have many opportunities to discuss any questions they have about Maharishi\'s teachings and the Transcendental Meditation movement. Topics include: Maharishi\'s time with his spiritual master, Guru Dev; how Maharishi left a recluse life in the Himalayas to teach in the world; the beginnings of the student Transcendental Meditation movement; the founding of Maharishi University of Management and Maharishi\'s visits to the campus; and the progressive unfoldment of Vedic technologies to enlighten the individual and enliven the basis of world peace. Credits: 2 credits. Prerequisites: for undergraduates: FOR 103.','Revival of Know. of Enlightenment 2wk WPA'),('FOR102','Forest','Weekend residence course','Ideal Daily Routine'),('FOR103','Health-Related Fitness','--no description yet--','Health-Related Fitness'),('FOR114',' Becoming a Professional Human Being - required 3 day WPA/ TM retreat $10 fee ','As leaders in our various organizations in the midst of an apparent worldwide meltdown, it is critical that we examine ways to assist associates to stay centered and cultivate a mastery over negativity.\"Becoming a Professional Human Being\" analyses the thinking patterns that structure our reactions to our environment on the job.Becoming a Professional Human Being requires personal accountability and effective personal leadership. It explores the laws that shape our reality and how we use them. Our health, success and our capacity to lead require self-responsibility and a harmonious mind-body relationship. This course reveals the secrets of this mind-body connection.','Becoming a Professional Human Being: Organizational Agility is Based on Individual Agility'),('FOR401','Revival of the Knowledge of Enlightenment','This course explores the extraordinary story of how the world reawakened to the knowledge of enlightenment. About fifty years ago Maharishi responded to the need of the time for higher consciousness and set out from India to bring the experience of transcending to the West. This experience ignited a global awakening, transforming consciousness and the quality of life for millions of people. Through guest speakers who worked personally with Maharishi, heartwarming videotapes, and interviews, students will get a picture of this transformative time in human history. Students will have many opportunities to discuss any questions they have about Maharishi\'s teachings and the Transcendental Meditation movement. Topics include: Maharishi\'s time with his spiritual master, Guru Dev; how Maharishi left a recluse life in the Himalayas to teach in the world; the beginnings of the student Transcendental Meditation movement; the founding of Maharishi University of Management and Maharishi\'s visits to the campus; and the progressive unfoldment of Vedic technologies to enlighten the individual and enliven the basis of world peace. Credits: 2 credits. Prerequisites: for undergraduates: FOR 103.','Revival of Knowledge of Enlightenment 2wk WPA'),('FOR403','Creativity and Image-   required  3 day MR/WPA','Visual expression in works of art reveals the artists connection with the deep laws fundamental to seeing and creating visual images. In this course, students explore art through a variety of videotape offerings presenting perspectives on creativity and the arts. Students see tapes of Maharishi speaking on the creative process and engage in discussions related to topics in creativity. Tape and discussion sessions are complemented by studio exercises that address the development of image in two dimensions, allowing course participants to focus on the creative process and experience it as a deep part of themselves. ','Creativity and the Image in Studio Art: Engaging the Dynamics of Natural Law'),('FOR405','Cross Cultural Comm. Opt.3-day MRC/WPA',NULL,'Cross Cultural Communication Optional 3-day MRC/WPA'),('FOR406','Communication  - required  3 day TMR/WPA ','..','Communication  - required  3 day TMR/WPA '),('FOR408','Cultural Integrity','In this forest academy course students will enjoy rest and rejuvenation through an easy and relaxing routine inside and outside the classroom. Our primary activity in class will be viewing and discussing Maharishi tapes on culture, invincibility, and world harmony. Students will have an opportunity to connect some fundamental SCI principles to their own cultures and to share their insights with the class. The primary homework will be to go to bed early each evening.','Cultural Integrity & World Harmony'),('FOR409','The Spiritual Quest - required 3 day TMR','Optional Res Course','The Spiritual Quest - required 3 day TMR'),('FOR414','Professional Human Being - required 3 dayTMR','NULL','Professional Human Being - required 3 dayTMR'),('FOR419','Inspiration through Film','2-day rounding This Forest Academy course will focus on films that have created an uplifting influence on society and attempt to isolate the fundamentals of inspiration and entertainment. Students will view select films from the past 75 years and discuss their messages and the impact they have had in the context of Maharishi\'s theory of communication and their role in heralding the coming Age of Enlightenment. (2 credits)','Inspiration through Film: Exploring the Fundamentals of Entertainment'),('FOR421','World Art and Media (Weekend rounding, meditators and sidhas)','(Weekend rounding, meditators and sidhas) In this course students discover how art and media from many cultures  express the universal qualities, principles, and structures of consciousness identified by Maharishi Vedic Science. Topics explored in art and media include: transcending, self-referral, creativity, archetypes or structures of awareness, qualities of pure consciousness (the Unified Field of Natural Law), qualities of the Veda, principles such as how the coexistence of opposite values structures wholeness in art and life, and the art of living in higher states of consciousness. Includes a field trip to a meditating artist\'s gallery. (No field trip fee. 2 credits)','How Painting, Sculpture, Architecture, and Film   Mirror Consciousness'),('FOR422','Human Relations req 3-day TMR/WPA','Human Relations req 3-day TMR/WPA','Human Relations req 3-day TMR/WPA'),('FOR423','Being a Leader - Optional Res Course','2-day rounding This course will focus on providing students with tools and techniques to be effective leaders and exceptional group participants. There will be a deep emphasis on improving communication skills and developing greater self-awareness. Students will learn about individual tendencies, team dynamics, mediation and facilitation. They will also learn how to recognize subtle body language in communication and how to recognize and address the needs and concerns of diverse individuals they are working with. Together we will explore what it means to be a leader within our communities, and specifically, in the Maharishi University of Management community. The class will be interactive and provide students with time to experience the lessons through various planned activities. (2 credits)','Leadership for Community Building: Progressing Together to Enjoy Fulfillment Together'),('FOR424','Professional Success: Skill in Action  (Optional Res Course)',NULL,'Skill in Action');
